(2064, 229, 'position', 'Chief Executive Officer'),
(2065, 229, '_position', 'field_5e38493eda0ad'),
(2066, 229, 'text', 'Prior to Element Critical, Ken founded and served as CEO at ByteGrid, a national platform of Tier 3+ data centers in the U.S. During his tenure at ByteGrid, he led the management team in acquiring five datacenters with over 800,000 SF of mission-critical space and 500 customers. Ken also led the successful strategic acquisitions of Annapolis-based Sidus BioData (a leading provider of compliant hosting solutions for FDA and HIPAA-HITECH regulated companies), and NetRiver, (a Seattle-based managed services provider) to diversify the ByteGrid portfolio and business.\r\n\r\nBefore Ken joined ByteGrid, he was the COO of The Mills Corporation, a NYSE-listed, publicly traded Real Estate Investment Trust that acquired, developed, leased and operated large-scale commercial real estate properties with total assets valued at nearly $8 billion.\r\n\r\nPrior to joining the Mills Corporation, Ken also held various leadership positions with Price Waterhouse and Kenneth Leventhal.'),
