(3099, 351, 'video_1_content_single', '<div>\r\n<div> This means that the data center as a data-driven solution can help you meet your flexible</div>\r\n<div>                    capacity</div>\r\n<div>                    needs, drive efficiency, and enable you to work with more customers and partners. In a nutshell,</div>\r\n<div>                    it</div>\r\n<div>                    should help you adapt to the growing and changing demands of the digital market.</div>\r\n</div>'),
