(3101, 351, 'video_2_title_author', 'About Element Critical'),
(3102, 351, '_video_2_title_author', 'field_5e3a8196c5f65'),
(3103, 351, 'video_2_text_author', '<div>\r\n<div>Element Critical is a leading provider of tailored data center and IT infrastructure services</div>\r\n<div>                        backed</div>\r\n<div>                        by solutions engineering expertise. With data centers in Silicon Valley and Northern</div>\r\n<div>                        Virginia,</div>\r\n<div>                        Element Critical’s Tier III hybrid IT-ready facilities are carrier-neutral, network-rich,</div>\r\n<div>                        concurrently maintainable and available in a variety of deployment sizes and densities.</div>\r\n<div>                        Element</div>\r\n<div>                        Critical cares as much about the people we serve as the servers we house. We offer a data</div>\r\n<div>                        center</div>\r\n<div>                        experience that brings solutions engineering and customer service out of the shadows and</div>\r\n<div>                        into</div>\r\n<div>                        the</div>\r\n<div>                        spotlight. For more information, visit www.elementcritical.com or contact</div>\r\n<div>                        sales@elementcritical.com.</div>\r\n</div>'),
