(350, 1, '2020-02-12 12:39:32', '2020-02-12 12:39:32', '', 'New site', 'It’s essential to find a data center partner you can trust to develop your critical infrastructure while you focus on your core business.  Our solutions are designed with technical and financial flexibility in mind to complement your offerings, increase your revenue, and deliver the best overall experience to your customers.', 'publish', 'closed', 'closed', '', 'new-site', '', '', '2020-02-12 12:40:05', '2020-02-12 12:40:05', '', 0, 'http://localhost/element/?post_type=solution&#038;p=350', 0, 'solution', '', 0),
(351, 1, '2020-02-20 15:46:36', '2020-02-20 15:46:36', 'We’re living in an interconnected time of smart phones, smart cars, smart homes, and even smart refrigerators. All of them generate an abundance of data. On average, users of the Internet generate 2.5 quintillion bytes of data each day, according to recent research by Domo.\r\n\r\nWhat many don’t consider is how much is happening behind the scenes to support the profusion of data we’re storing and accessing on a daily basis. Most of us take it for granted, much like flipping a light switch with the certainty the lights will go on/off. When they don’t, it’s a shock to our system.\r\n\r\nA significant amount of time, space, compute, cooling, power, and money go into the processing, storing, managing, securing, and analyzing of data. It’s what enables the many real-time online transactions we count on hundreds of times per day.\r\n\r\nAll the back-end work taking place in digital data centers also empower enterprises to adjust and pivot on-demand to deliver a fast, uninterrupted experience. So, in essence, one of the major responsibilities of our data centers is to ensure that “the computing lights never go out.”\r\n\r\nBased on the CapGemini/RBS World Payments Report 2015, total non-cash payments globally, including all wholesale and retail electronic payments, amounted to 389 billion per year. That’s the equivalent to 1.06 billion movements per day.\r\n\r\nBecause data is expected to continue growing at lightning speed, data centers are evolving into data-driven solution centers that can support the growing need to handle unpredictable amounts of data, devices, users, and things.\r\n<h5>Cloud Expansion Enabling Faster and Scalable IT</h5>\r\nThe digital economy is driving the need for digital business transformation. At the core of turning data centers into solution centers is the ability to offer and enable faster IT, so they can quickly deliver scalability in transporting, processing and storing unlimited quantities of data.', 'EXAMPLE – Element  Copy  Copy  Copy  Copy  Copy  Copy  Copy', 'We’re living in an interconnected time of smart phones, smart cars, smart homes, and even smart refrigerators. All of them generate an abundance of data. On average, users of the Internet generate 2.5 quintillion bytes of data each day, according to recent research by Domo', 'inherit', 'closed', 'closed', '', '298-revision-v1', '', '', '2020-02-20 15:46:36', '2020-02-20 15:46:36', '', 298, 'http://localhost/element/2020/02/20/298-revision-v1/', 0, 'revision', '', 0) ;
